import React from 'react';
import Vehicle from './Vehicle'


const Peopleinfo = ({ name, birth_year, height, mass, vehicle }) => {
    return (
        <div className="tc bg-light-green dib br3 ma2 grow bw2 shadow-5 pa4">
            <h5>{name}</h5>
            <p>{birth_year}</p>
            <p>{height}</p>
            <p>{mass}</p>
            <p>{
                people.map((vehicles, i) => {
                    return (
                        <Vehicle
                            key={i}
                            name={`Name: ${vehicles[i].name}`}
                            model={`Model: ${vehicles[i].model}`}
                            height={`Height: ${vehicles[i].height}`}
                            mass={`Mess: ${vehicles[i].mass}`}
                        />
                    );
                })
                }</p>
        </div>  
    );
}

export default Peopleinfo;
